(1, 'แข่งขันเขียนโปรแกรมควบคุมหุ่นยนต์ผู้ช่วยนักบินอวกาศ Astrobee ', '<p>องค์การสำรวจอวกาศญี่ปุ่น (Japan Aerospace Exploration Agency: JAXA) และองค์การบริหารการบินและอวกาศแห่งชาติสหรัฐ (National Aeronautics and Space Administration: NASA) ขอเชิญนักเรียนทุกระดับชั้น นักศึกษา หรือเทียบเท่า สมัครเข้าร่วมการ<strong>แข่งขันเขียนโปรแกรมควบคุมหุ่นยนต์ผู้ช่วยนักบินอวกาศ Astrobee \"Kibo Robot Programming Challenge\"</strong> ภายใต้โปรแกรม JAPAN US Open Platform Partnership (JP-US OP3) ชิงเงินรางวัลมูลค่ารวม 60,000 บาท พร้อมเกียรติบัตร และโอกาสเป็นตัวแทนเข้าร่วมโครงการแข่งขัน The 3rd Kibo Robot Programming Challenge รอบชิงแชมป์โลก ณ ศูนย์อวกาศสึกุบะ (Tsukuba Space Center) ประเทศญี่ปุ่น</p><p>&nbsp;</p><p><strong>วัตุประสงค์</strong></p><ul><li>สร้างโอกาสเพื่อเยาวชนไทยเรียนรู้ผ่านองค์ความรู้ที่ทันสมัย ได้ฝึกฝนทักษะการเขียนโปรแกรม และเสริมสร้างความรู้ด้านวิทยาศาสตร์ เทคโนโลยี วิศวกรรม และคณิตศาสตร์</li><li>เยาวชนไทยได้รับการเสริมสร้างให้มีวินัยในการทำงาน รู้จักการทำงานร่วมกับผู้อื่น การแบ่งหน้าที่และทำงานเป็นกลุ่มได้อย่างมีประสิทธิภาพ</li><li>เยาวชนผู้ชนะเลิศการแข่งขันในระดับประเทศ ได้มีโอกาสเข้าร่วมการแข่งขันรอบชิงแชมป์โลกร่วมกับเยาวชนต่างประเทศ สามารถสร้างชื่อเสียงให้กับประเทศ และได้รับประสบการณ์จากการแข่งขันในเวทีระดับนานาชาติ</li><li>ได้รับโอกาสในการพูดคุย แลกเปลี่ยนความรู้กับนักวิทยาศาสตร์ วิศวกร NASA และ JAXA ช่วยสร้างแรงบันดาลใจในการพัฒนาการศึกษา และวิชาชีพของตนเอง ผ่านโครงการแข่งขันครั้งนี้</li></ul><p><strong>กติกาการแข่งขัน</strong> (สำหรับประเทศไทย)</p><ul><li>เปิดโอกาสให้นักเรียนทุกระดับชั้นจนถึงระดับปริญญาตรีหรือเทียบเท่า สมัครเข้าร่วมการแข่งขันประเภททีม สมาชิกทีมละ 3 คน (หัวหน้าทีม 1 คน และสมาชิก 2 คน) สมาชิกภายในทีมสามารถเรียนอยู่ต่างระดับชั้นและต่างสถาบันการศึกษาได้</li><li>กรอกใบสมัครทางออนไลน์ที่ https://bit.ly/3v5TdcS เมื่อทางโครงการฯ ได้รับข้อมูลใบสมัครแล้ว ระบบอัตโนมัติจะจัดส่ง Team ID ให้กับตัวแทนทีมทางอีเมล เพื่อใช้สำหรับเข้าสู่ระบบเพื่อการทดสอบโปรแกรมในระบบ Simulation และใช้เป็น Team ID สำหรับส่งไฟล์ APK เข้าร่วมการแข่งขัน</li><li>ทีมผู้เข้าแข่งขันต้องเขียนโปรแกรมคอมพิวเตอร์ภาษา JAVA ปฏิบัติภารกิจตามที่กำหนด เพื่อบังคับหุ่นยนต์ผู้ช่วยนักบินอวกาศ&nbsp; Astrobee ของ NASA ในระบบ Simulator บน Server ของ JAXA ประเทศญี่ปุ่น ที่ลิงก์ https://jaxa.krpc.jp/ โดยสามารถศึกษาได้จากคู่มือประกอบการแข่งขัน</li><li>การแข่งขันรอบชิงแชมป์โลก ในช่วงเดือนกันยายน 2565 จะเป็นการ Run Program จริงบนสถานีอวกาศนานาชาติ (ISS/Kibo) เพื่อควบคุมหุ่นยนต์ Astrobee และถ่ายทอดสดจาก Tsukuba Space Center ประเทศญี่ปุ่น โดยสื่อสารแบบ Real-time กับสถานีอวกาศนานาชาติ ซึ่งมีนักบินอวกาศเป็นผู้ควบคุมการแข่งขัน</li></ul><p>หมายเหตุ ผลตัดสินการแข่งขันของผู้จัดงานถือเป็นที่สิ้นสุด กำหนดการและข้อกำหนดอาจมีการเปลี่ยนแปลงตามความเหมาะสม</p><p><strong>กำหนดการ</strong></p><ul><li>เปิดรับใบสมัครถึงวันที่ 16 พฤษภาคม 2565 เวลา 23.59 น.</li><li>การแข่งขันรอบชิงแชมป์ประเทศไทย กรกฎาคม 2565</li><li>ประกาศผลแชมป์ประเทศไทย กรกฎาคม 2565</li><li>การแข่งขันรอบชิงแชมป์โลก เดือนกันยายน 2565</li></ul><p><strong>รางวัลการแข่งขัน</strong></p><ul><li>รางวัลทีมชนะเลิศ เงินรางวัล 30,000 บาท พร้อมเกียรติบัตร</li><li>รางวัลทีมรองชนะเลิศ อันดับ 1 เงินรางวัล 15,000 บาท พร้อมเกียรติบัตร</li><li>รางวัลทีมรองชนะเลิศ อันดับ 2 เงินรางวัล 9,000 บาท พร้อมเกียรติบัตร</li><li>รางวัลทีมนำเสนอยอดเยี่ยม (จำนวน 2 รางวัล) เงินรางวัล 3,000 บาท พร้อมเกียรติบัตร</li><li>ทีมที่ส่งไฟล์ APK เข้าร่วมการแข่งขันจะได้รับเกียรติบัตรจากโครงการ (e-Certificate)</li></ul><p><strong>ติดต่อสอบถาม</strong></p><ul><li>E-Mail: spaceeducation@nstda.or.th</li><li>Facebook: NSTDA SPACE Education</li></ul><p>ข่าวประชาสัมพันธ์ : NSTDA SPACE Education</p><p><strong>Contest Type: &nbsp;</strong><a href=\"http://contestwar.com/th/contest-type-28\">คอมพิวเตอร์/IT</a></p><p><strong>Eligibility: &nbsp;</strong><a href=\"http://contestwar.com/th/eligibility-3\">นักเรียน</a> <a href=\"http://contestwar.com/th/eligibility-4\">นิสิต นักศึกษา</a></p><p><strong>มูลค่าเงินรางวัลรวม:&nbsp;</strong></p><p>60,000 Baht</p><p><strong>Contest\'s URL: &nbsp;</strong><a href=\"https://www.nstda.or.th/spaceeducation/kibo-rpc2022/\">รายละเอียดเพิ่มเติม ดาวน์โหลดรายละเอียดและใบสมัคร</a></p><p><strong>Tags: &nbsp;</strong><a href=\"http://contestwar.com/th/tags/7780\">แข่งขันเขียนโปรแกรม</a></p><p><a href=\"http://contestwar.com/th/tags/7937\">kibo robot programming challenge</a></p><p><strong>File attachments:&nbsp;</strong></p><p><strong>หมดเขต:&nbsp;</strong></p><p>11 เม.ย. 2022 (All day) to 16 พ.ค. 2022 (All day)</p><p><strong>Published by: &nbsp;</strong><a href=\"http://www.contestwar.com/\">Contestwar</a></p><p>\"&gt;</p>', 1, '0000-00-00', '2022-12-25 20:31:39', 'Admin', 5, '38296894520221225_213139.jpg', 'Send'),
(2, 'แข่งขันทักษะคอมพิวเตอร์ \"MOS Olympic Thailand Competition 2022\"', '<p>ARIT ขอเชิญนักเรียน นักศึกษา หรือเทียบเท่า สมัครเข้าร่วมการ<strong>แข่งขันทักษะคอมพิวเตอร์ \"MOS Olympic Thailand Competition 2022\"</strong> ชิงทุนการศึกษา พร้อมโอกาสเป็นตัวแทนประเทศไทยไปแข่งขัน ณ ประเทศสหรัฐอเมริกา</p><p><strong>วัตถุประสงค์</strong></p><ul><li>เพื่อคัดเลือกตัวแทนนักเรียน, นิสิต, นักศึกษา เข้าร่วมการแข่งขันในระดับประเทศ และค้นหาตัวแทนจากประเทศไทยเข้าร่วมแข่งขัน ณ ประเทศสหรัฐอเมริกา</li><li>เพื่อเปิดโอกาสให้นักเรียน นิสิต นักศึกษา ได้แสดงความรู้ ความสามารถในทางที่ถูกต้อง และเห็นถึงความสำคัญในการมีพื้นฐานทักษะทางด้านเทคโนโลยีสารสนเทศ</li><li>เพื่อสนับสนุนให้สถาบันการศึกษา มีกิจกรรมวิชาการ และสนับสนุนให้นักเรียน นักศึกษา ได้แสดงความสามารถทางด้านไอทีภายใต้มาตรฐานสากลที่ทั่วโลกให้การยอมรับ</li><li>เพื่อส่งเสริมให้เยาวชนได้ค้นพบความสามารถ ความถนัด ความสนใจ ของตนเอง และได้พัฒนาความสามารถนั้นอย่างเต็มศักยภาพ</li><li>เพื่อเพิ่มโอกาส และประสบการณ์ทั้งด้านวิชาการ และการเปิดโลกทัศน์ มีกิจกรรมร่วมกับเยาวชนประเทศอื่นๆ ทั่วโลก</li></ul><p><strong>คุณสมบัติของผู้สมัคร</strong></p><ul><li>เป็นผู้ที่กำลังศึกษาในระดับมัธยมศึกษาตอนปลายหรือ ปวช. จนถึงระดับอุดมศึกษาหรือ ปวส. ไม่จำกัดสาขา หรือชั้นปี โดยมีอายุระหว่าง 16-21 ปี บริบูรณ์ ณ วันที่ 15 มิถุนายน 2565</li><li>เป็นเยาวชนไทยที่มีความรู้พื้นฐานทางด้านการใช้ชุดโปรแกรม Microsoft Word, Microsoft Excel, Microsoft PowerPoint Version 2019</li></ul><p><strong>โปรแกรมการแข่งขัน</strong> (โจทย์เป็นภาษาอังกฤษ)</p><ul><li>ผู้สมัคร 1 คน ต้องทำการแข่งขันครบทั้ง 3 โปรแกรม และเลือกสมัครได้เพียง 1 Version เท่านั้น</li><li>Version 2019 ประกอบด้วยการแข่งขัน 3 โปรแกรม<ul><li>Microsoft Word (Microsoft 365 Apps and Office 2019)</li><li>Microsoft Excel (Microsoft 365 Apps and Office 2019)</li><li>Microsoft PowerPoint (Microsoft 365 Apps and Office 2019)</li></ul></li></ul><p><strong>การสมัครสมัคร&nbsp; </strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p><ul><li>รับสมัครตั้งแต่วันที่ 1 มิถุนายน - 10 พฤศจิกายน 2565<br>(กรณีจะใช้สิทธิอบรมต้องสมัครและชำระเงินก่อนวันที่ 10 พฤศจิกายน 2565เท่านั้น)</li><li>สมัครผ่านเว็บไซต์ www.aritcompetition.com &nbsp;</li><li>ค่าธรรมเนียมการสมัครเข้าร่วมโครงการ 2,000 บาท (ราคารวมภาษีมูลค่าเพิ่มแล้ว)</li></ul><p><strong>รูปแบบและสถานที่การเข้าร่วมกิจกรรม&nbsp; : รอบอบรม (Online / Onsite)</strong><br>โครงการจัดติวพิเศษให้กับผู้สมัครเข้าร่วมกิจกรรมในรูปแบบ Hybrid ผ่านช่องทางที่ทางบริษัทฯ กำหนด<br>หมายเหตุ</p><ul><li>ผู้สมัครที่มีสิทธิเข้าอบรมต้องชำระค่าสมัครให้ครบถ้วน</li><li>ผู้สมัคร 1 ท่านสามารถเข้าอบรมได้ทั้ง 3 โปรแกรมตาม Version ที่สมัครไว้</li></ul><p><strong>รอบแข่งขัน และประกาศรางวัล (Onsite)</strong><br>วันเสาร์ที่&nbsp; 26 พฤศจิกายน 2565 ณ มหาวิทยาลัยราชภัฎจันทรเกษม จังหวัดกรุงเทพมหานคร<br>หมายเหตุ</p><ul><li>ทางบริษัทฯ เปิดการสอบแข่งขันในรูปแบบ Onsite เท่านั้น**</li><li>ผู้สมัครเข้าแข่งขันทุกท่านต้องเข้าสอบครบทั้ง 3 โปรแกรม และอยู่ร่วมพิธีประกาศผลการแข่งขัน**</li><li>ผู้สมัครเข้าแข่งขันและอาจารย์ที่ปรึกษาทุกท่านต้องมีผลการตรวจ ATK ก่อนเข้าร่วมกิจกรรมทุกท่าน**</li><li>ค่าเดินทางและค่าที่พัก เป็นความรับผิดชอบของทางสถาบันการศึกษา</li></ul><p><strong>ติดต่อสอบถาม</strong></p><ul><li>โทร. 02-610-3099 ต่อ 3081</li><li>E-mail : achirayat@ar.co.th / nalinthornw@ar.co.th</li></ul><p>ข่าวประชาสัมพันธ์ : K. Nalinthorn Wimonpradit</p><p><strong>Contest Type: &nbsp;</strong><a href=\"http://contestwar.com/th/contest-type-28\">คอมพิวเตอร์/IT</a></p><p><strong>Eligibility: &nbsp;</strong><a href=\"http://contestwar.com/th/eligibility-3\">นักเรียน</a> <a href=\"http://contestwar.com/th/eligibility-4\">นิสิต นักศึกษา</a></p><p><strong>Contest\'s URL: &nbsp;</strong><a href=\"https://www.aritcompetition.com/\">รายละเอียดเพิ่มเติม และสมัคร</a></p><p><strong>ดาวน์โหลด: &nbsp;</strong><a href=\"https://www.aritcompetition.com/assets/doc/NEW-MOS-2022.pdf\">ดาวน์โหลดรายละเอียด</a></p><p><strong>Tags: &nbsp;</strong><a href=\"http://contestwar.com/th/tags/6560\">แข่งขันทักษะคอมพิวเตอร์</a>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href=\"http://contestwar.com/th/tags/7917\">mos olympic thailand competition 2022</a></p><p><strong>File attachments:&nbsp;</strong></p><p><strong>หมดเขต: &nbsp;</strong>25 ส.ค. 2022 08:30 to 10 พ.ย. 2022 16:30</p><p><strong>Published by: &nbsp;</strong><a href=\"http://www.contestwar.com/\">Contestwar</a></p>', 2, '2022-12-26', '2022-12-25 20:39:58', 'Admin', 5, '62870359720221225_213958.jpg', 'Send'),
(3, 'Engineering Quest 2023 : เวทีการแข่งขันตอบปัญหาทางวิศวกรรม !', '<h2>คำอธิบายกิจกรรม</h2><p>???????? โครงการการแข่งขันตอบปัญหาวิชาการทางด้านวิศวกรรม ระดับมัธยมศึกษาตอนปลาย (หรือเทียบเท่า) ????????</p><p>????การแข่งขันตอบปัญหาวิชาการทางด้านวิศวกรรม หรือ Engineering Quest 2023 เป็นการแข่งขันภายใต้โจทย์ปัญหาที่ใช้เนื้อหาเกี่ยวกับวิทยาศาสตร์ คณิตศาสตร์ โดยใช้ความรู้ไม่เกินระดับชั้นมัธยมศึกษาตอนปลาย</p><p>???? น้อง ๆ ม.ปลาย, ปวช. (หรือเทียบเท่า) คนไหนที่อยากลองประสบการณ์แข่งขันวิชาการสุดท้าทายจะพลาดกิจกรรมนี้ไม่ได้เลย ???? ถ้าอยากรู้ว่ากิจกรรมนี้จะยาก สนุก และท้าทายขนาดไหนต้องมาลองสัมผัสเอง โดยการแข่งขันวันแรกคือวันที่ 20 ธันวาคม 2565 รูปแบบออนไลน์ ⏰</p><p>พี่รอต้อนรับน้อง ๆ ทุกคนที่สนใจอยู่น้า รวมทีมกันให้ครบ 3 คน และกรอกใบสมัครเลย แล้วมาเจอกัน ณ มจธ.บางมด ????????❣</p><h3>???? คุณสมบัติผู้เข้าแข่งขันและหลักเกณฑ์ในการเข้าร่วมแข่งขัน</h3><p>1) ✅ ผู้เข้าร่วมแข่งขันต้องเป็นนักเรียนที่กำลังศึกษาอยู่ในระดับมัธยมศึกษาตอนปลาย หรือนักศึกษาอาชีวศึกษาในระดับ ปวช. หรือเทียบเท่า<br>2) ✅ ผู้เข้าร่วมแข่งขันจะต้องสมัครในรูปแบบกลุ่มบุคคล ทั้งนี้กลุ่มละ 3 คน โดยสมาชิกต้องศึกษาอยู่ในสถาบันเดียวกันและมีอาจารย์ที่ปรึกษาอย่างน้อย 1 ท่าน แต่ไม่เกิน 2 ท่าน<br>3) ✅ อาจารย์ที่ปรึกษาจะต้องมีตำแหน่งเป็นครูหรืออาจารย์ประจำของสถาบันการศึกษาที่นักเรียนหรือผู้สมัครศึกษาอยู่<br>4) ✅ ผู้เข้าร่วมแข่งขัน 1 คน สามารถสมัครเพียง 1 กลุ่มเท่านั้น และแต่ละสถาบันสามารถส่งได้ไม่เกิน 3 กลุ่ม</p><h3>???? เอกสารที่ประกอบ</h3><p>1) ???? เอกสารยืนยันการเป็นนักเรียนของสถาบันการศึกษา (ปพ.7)<br>2) ???? เอกสารรับรองการเป็นครูหรืออาจารย์ที่ปรึกษาของกลุ่ม และเป็นอาจารย์ที่สังกัดในสถาบันการศึกษาเดียวกันกับผู้เข้าร่วมการแข่งขัน (สามารถดาวน์โหลดไฟล์เอกสารรับรองอาจารย์ได้ที่ : ???? https://kmutt.me/EQ23Tform หรือหากมีแบบฟอร์มของโรงเรียน ท่านสามารถใช้แทนได้ แต่ต้องมีลายเซ็นผู้อำนวยการโรงเรียนกำกับ)</p><p>???? โดยรับสมัครผ่านทางออนไลน์ที่ลิงก์: ???? <a href=\"https://kmutt.me/EQ23regis\">https://kmutt.me/EQ23regis</a></p><p>ท่านสามารถสมัครได้ตั้งแต่วันนี้ จนถึงวันที่ 28 พฤศจิกายน 2565</p><p><strong>???? หมายเหตุ: </strong>สำหรับกลุ่มที่มีปัญหาเรื่องเอกสารสามารถติดต่อพี่ ๆ ฝ่ายประสานงานโครงการได้ เรายินดีให้ความช่วยเหลือ</p><h3>???? ลักษณะการแข่งขัน</h3><p>เป็นการแข่งขันตอบปัญหาวิชาการทางด้านวิศวกรรม โดยมีการแบ่งรอบการแข่งขันเป็นทั้งหมด 3 รอบ</p><p>1) ⭐ รอบคัดเลือกรอบที่ 1 เป็นการคัดเลือกผ่านการทำข้อสอบแบบรายบุคคลผ่านระบบออนไลน์ โดยพิจารณาการคัดเลือกผ่านการนำคะแนนของสมาชิกในกลุ่มทั้ง 3 คนมารวมกันเป็นคะแนนกลุ่ม และทำการคัดเลือกให้เหลือ 50 กลุ่ม โดยเรียงลำดับตามคะแนนสูงไปต่ำ เพื่อเข้าสู่รอบคัดเลือกรอบที่ 2<br>2) ⭐ รอบคัดเลือกรอบที่ 2 เป็นการคัดเลือกผ่านการทำข้อสอบแบบกลุ่ม ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี โดยพิจารณาการคัดเลือกจากคะแนนสอบของกลุ่ม และทำการคัดเลือกให้เหลือ 20 กลุ่ม เพื่อเข้าสู่รอบชิงชนะเลิศ<br>3) ⭐รอบชิงชนะเลิศ เป็นการแข่งขันแบบกลุ่ม ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี โดยพิจารณาคัดเลือกกลุ่มที่ได้รับรางวัลจากคะแนนของกลุ่ม ตามลำดับคะแนนจากสูงไปต่ำ ซึ่งมีทั้งหมด 5 รางวัล คือ รางวัลชนะเลิศ, รางวัลรองชนะเลิศอันดับที่ 1, รางวัลรองชนะเลิศอันดับที่ 2, และรางวัลชทเชย 2 รางวัล</p><p>???? <strong>หมายเหตุ:</strong> โดยก่อนวันแข่งขันในแต่ละรอบ จะมีการแจ้งข้อกำหนดในการสอบของแก่กลุ่มผู้มีสิทธิ์เข้าแข่งขันผ่านอีเมล ????</p><h3>???? กำหนดการแข่งขัน</h3><p>การแข่งขันจะมีทั้งสิ้น 2 วันดังนี้</p><p>1) ???? วันอังคารที่ 20 ธันวาคม 2565 จะเป็นการแข่งขันรอบคัดเลือกรอบที่ 1 ผ่านทางออนไลน์ ???? เวลา ⏲ 12:30-16:30 น.<br>2) ???? วันศุกร์ที่ 20 มกราคม 2566 จะเป็นการแข่งขันรอบคัดเลือกรอบที่ 2 และรอบชิงชนะเลิศ ณ คณะวิศวกรรมศาสตร์ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี (มจธ.บางมด) ???? เวลา ⏲ 08:00-17:30 น.</p><p>???? <strong>หมายเหตุ:</strong> กำหนดการอาจมีการเปลี่ยนแปลง โปรดติดตามข้อมูลผ่าน Facebook และอีเมล</p><h3>???? รางวัลและสิทธิพิเศษ</h3><p>กลุ่มผู้เข้าแข่งขันที่ได้รับรางวัลในรอบชิงชนะเลิศจะได้รับรางวัลดังนี้<br>???? รางวัลชนะเลิศ ทุนการศึกษา 10,000 บาท พร้อมโล่ประกาศเกียรติคุณ<br>???? รางวัลรองชนะเลิศอันดับที่หนึ่ง ทุนการศึกษา 5,000 บาท พร้อมโล่ประกาศเกียรติคุณ<br>???? รางวัลรองชนะเลิศอันดับที่สอง ทุนการศึกษา 3,000 บาท พร้อมโล่ประกาศเกียรติคุณ<br>???? รางวัลชมเชย (2 รางวัล) ทุนการศึกษา 1,000 บาท พร้อมเกียรติบัตร</p><p>???????? ผู้ที่ได้รับรางวัลที่ 1-3 มีสิทธิ์ได้รับการพิจารณาเข้าศึกษาต่อในคณะวิศวกรรมศาสตร์ หลังจากผ่านการพิจารณาของภาควิชาแล้ว ????????</p><p>✨✨ผู้เข้าร่วมการแข่งขันทุกท่านจะได้รับเกียรติบัตรในการเข้าร่วมแข่งขัน✨✨</p><h3>???? เนื้อหาที่ใช้ในการแข่งขัน</h3><p>เนื้อหาเกี่ยวกับวิทยาศาสตร์ คณิตศาสตร์ เทคโนโลยี โดยระดับความรู้ไม่เกินระดับชั้นมัธยมศึกษาตอนปลาย ตาม ???? หลักสูตรแกนกลาง พุทธศักราช 2551 (ฉบับปรับปรุง พ.ศ. 2560) รวมถึงการคิดวิเคราะห์เชิงตรรกะ ความรู้รอบตัวด้านวิศวกรรม และนวัตกรรมใหม่ ๆ ที่น่าสนใจอีกด้วย</p><h3>???? ติดต่อสอบถามรายละเอียดเพิ่มเติม</h3><p>ฝ่ายประสานงานโครงการแข่งขันตอบปัญหาวิชาการทางด้านวิศวกรรม ระดับมัธยมศึกษาตอนปลาย ปีการศึกษา 2565 คณะวิศวกรรมศาสตร์ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี</p><p>???? ทางโทรศัพท์<br>???? ธนกฤต จันทะวัน (พี่ดล) เบอร์โทรศัพท์: 08-1046-9748<br>???? กันตพัฒน์ สุวรรณหงษ์ (พี่บั๊มพ์) เบอร์โทรศัพท์: 08-4525-5934</p><p>???? ทางออนไลน์<br>????Facebook โครงการ: <a href=\"https://www.facebook.com/profile.php?id=100087709743668\">https://www.facebook.com/profile.php?id=100087709743', 1, '2022-12-26', '2022-12-26 04:46:09', 'Admin', 5, '89311793220221226_054609.jpg', 'Send'),
(4, 'การแข่งขันประกวดออกแบบตกแต่งร้านค้าด้วยโปรแกรม Unity', '<p>บริษัท บล็อกเชน สโตร์ จำกัด ขอเชิญนักเรียน นิสิตนักศึกษา และประชาชนทั่วไป ส่งผลงานเข้าร่วมการ<strong>ประกวดออกแบบตกแต่งร้านค้าด้วยโปรแกรม Unity</strong> ตามหัวข้อที่กำหนดชิงรางวัลเงินดิจิตอล BCST มูลค่ารวมกว่า 31,000 BCST</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>วัตถุประสงค์</strong></p><ol><li>เพื่อเปิดโอกาสให้กับนักเรียน นิสิตนักศึกษา และบุคคลทั่วไป ได้แสดงความคิดสร้างสรรค์ ได้แสดงฝีมือและศักยภาพผ่านผลงานการประกวด</li><li>เพื่อเผยแพร่ประชาสัมพันธ์บริษัท บล็อกเชน สโตร์ จำกัดให้เป็นที่รู้จักในวงกว้าง</li><li>เพื่อเผยแพร่ประชาสัมพันธ์เงินสกุล BCST ซึ่งเป็นสกุลเงินดิจิตอล ของทางบริษัท</li></ol><p><strong>คุณสมบัติผู้เข้าประกวด</strong><br>นักเรียน นิสิตนักศึกษาในสถาบันการศึกษาในประเทศไทยทุกสถาบัน หรือ บุคคลทั่วไป ทั้งสัญชาติไทยและสัญชาติอื่น</p><p><strong>ประเภทของการประกวด</strong></p><ol><li>การประกวดออกแบบเมือง</li><li>การประกวดออกแบบร้านค้า</li></ol><p><strong>เงื่อนไขและข้อกำหนด</strong></p><ol><li>ต้องสร้างสรรค์ผลงานด้วยโปรแกรม Unity เวอร์ชั่น 2017 ขึ้นไป</li><li>กำหนดให้ใช้ไฟล์ฟอร์เมต*.FBX, *.SKP, *.OBJ ในส่วนของโมเดล 3D โดยไม่จำกัดโปรแกรมที่ใช้</li><li>เพื่อให้การแสดงผลงานบนเว็บไซต์ของเราได้ ผู้เข้าประกวดจำเป็นต้องเพิ่ม \"RigidBodyFPSController\" จาก Standard assets ของ Unity เท่านั้น</li><li>โมเดลที่ใช้ตกแต่งห้องต้องจัดทำเป็น Prefab ทุกชิ้นตามความเหมาะสม</li><li>สามารถใช้เทคนิคการจัดแสงได้ทุกรูปแบบ</li><li>สามารถใช้ \"Shader Calibration Scene\" ซึ่งเป็น package จาก Unity Asset Store ได้ แต่ไม่อนุญาตให้ใช้ asset อื่นใด รวมถึงโมเดลต่างๆ ต้องออกแบบดัวยตัวเองเท่านั้น</li><li>ผลงานที่เสร็จแล้วต้องจัดทำให้อยู่ในสองรูปแบบดังนี้<ul><li>Unity package : ให้ผู้เข้าประกวด export โปรเจคให้อยู่ในรูปแบบ *.unitypackage โดยเข้าไปที่ \"Assets&gt;Export Package\" เลือก \"Include dependencies\" จากนั้นคลิก \"Export\"</li><li>WebGL : ให้ผู้เข้าประกวด สร้างโปรเจคให้เป้นแอพลิเคชั่นในรูปแบบ WebGL โดยเข้าไปที่ \"File &gt; Build Settings\" เลือก WebGL และคลิก \"Switch Platform\" จากนั้นกดปุ่ม \"Build\"</li></ul></li><li>กำหนดข้อมูลพื้นฐานและขนาดไฟล์ *.unitypackage สูดสุดไว้ดังนี้<ul><li>สำหรับงานออกแบบเมือง<ul><li>ขนาดไฟล์สูงสุดไม่เกิน 150 MB</li><li>สร้างสรรค์ผลงานให้อยู่บนพื้นที่ขนาด 200 เมตร x 200 เมตร</li><li>ขนาดของอาคารต้องไม่เกิน 5 ชั้น หรือ 30 เมตร</li></ul></li><li>สำหรับงานออกแบบร้านค้า<ul><li>ขนาดไฟล์สูงสุดไม่เกิน 75 MB</li><li>สร้างสรรค์ผลงานให้อยู่ในร้านค้า 2 ขนาดดังนี้ (เลือกอย่างใดอย่างหนึ่ง สำหรับการส่ง 1 ครั้ง)<ul><li>5 เมตร x 5 เมตร โดยให้ฝ้าเพดานสูงจากพื้น 3.5 - 4.0 เมตร</li><li>7.5 เมตร x 5 เมตร โดยให้ฝ้าเพดานสูงจากพื้น 3.5 - 4.0 เมตร</li></ul></li></ul></li></ul></li><li>&nbsp;กำหนดให้มีการจัดการระบบแฟ้มข้อมูลดังนี้<ul><li>Resource&nbsp;&nbsp; &nbsp;สำหรับเก็บไฟล์ต่าง ๆ ที่ใช้้ประกอบการทำงาน เช่น Texture</li><li>3DModel&nbsp;&nbsp; &nbsp;สำหรับเก็บไฟล์ 3D ต่าง ๆ</li><li>Prefab&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;สำหรับเก็บ prefab</li><li>Scripts&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;สำหรับเก็บไฟล์สคริปต์ทั้งหมดที่ใช้ในงาน</li><li>Scenes&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;สำหรับเก็บ scene ทั้งหมดในงาน</li></ul></li><li>ให้ตั้งชื่อไฟล์เป็น “ชื่อ_สกุล.unitypackage” ด้วยภาษาอังกฤษตัวพิมพ์ใหญ่ เช่น&nbsp;<br>“NAME_SURNAME.package”</li><li>สำหรับ WebGL ให้บีบอัดไฟล์ทั้งหมดเป็น *.zip และตั้งชื่อไฟล์เป็น “ชื่อ_สกุล.zip” ด้วยภาษาอังกฤษตัวพิมพ์ใหญ่ เช่น&nbsp;<br>“NAME_SURNAME.zip”</li><li>ผลงานที่ส่งเข้าประกวด จะต้องเป็นผลงานที่ออกแบบด้วยตัวเอง ห้ามเป็นผลงานที่ลอกเลียนแบบจากงานของผู้อื่น หรือมีส่วนใดที่เป็นลิขสิทธิ์ของบุคคลภายนอก หรือละเมิดลิขสิทธิ์ใด ๆ ทั้งสิ้น หากมีการร้องเรียนเกิดขึ้น ทางผู้เข้าประกวดจะต้องเป็นผู้รับผิดชอบความเสียหายแต่เพียงผู้เดียว</li><li>ไม่จำกัดจำนวนการส่งผลงาน</li><li>ผลงานการประกวด ถือเป็นกรรมสิทธิ์ของบริษัท ซึ่งสามารถนำไปแก้ไข ปรับปรุง และเผยแพร่ในสื่อต่าง ๆ ได้โดยไม่ต้องขออนุญาต</li><li><strong>ผลการตัดสินของคณะกรรมการถือเป็นที่สิ้นสุด จะฟ้องร้องมิได้</strong></li></ol><p><strong>กำหนดการประกวด</strong></p><ul><li>เปิดรับผลงานการประกวด ตั้งแต่วันนี้ ถึง 5 ตุลาคม 2561</li><li>ประกาศผลรางวันทาง facebook.com/bcschain.io และเว็ขไซต์ bcschain.io วันที่ 12 ตุลาคม 2561</li><li>ทางบริษัทฯ จะจัดแสดงผลงานของท่านบนช่องทางที่เหมาะสมซึ่งจะประกาศให้ทราบต่อไป</li></ul><p><strong>รางวัลการประกวด</strong></p><ul><li>กลุ่ม : ออกแบบเมือง<ul><li>รางวัลชนะเลิศ&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;6,500 BCST*&nbsp;&nbsp; &nbsp;จำนวน 1 รางวัล</li><li>รางวัลรองชนะเลิศ อันดับที่ 1&nbsp;&nbsp; &nbsp;3,000 BCST*&nbsp;&nbsp; &nbsp;จำนวน 2 รางวัล</li><li>รางวัลรองชนะเลิศ อันดับที่ 2&nbsp;&nbsp; &nbsp;1,000 BCST*&nbsp;&nbsp; &nbsp;จำนวน 3 รางวัล</li></ul></li><li>กลุ่ม : ออกแบบร้านค้า<ul><li>รางวัลชนะเลิศ&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;6,500 BCST*&nbsp;&nbsp; &nbsp;จำนวน 1 รางวัล</li><li>รางวัลรองชนะเลิศ อันดับที่ 1&nbsp;&nbsp; &nbsp;3,000 BCST*&nbsp;&nbsp; &nbsp;จำนวน 2 รางวัล</li><li>รางวัลรองชนะเลิศ อันดับที่ 2&nbsp;&nbsp; &nbsp;1,000 BCST*&nbsp;&nbsp; &nbsp;จำนวน 3 รางวัล</li></ul></li></ul><p>ข่าวประชาสัมพันธ์ : K. Kumpanat Mangkala</p><p>\"&gt;</p>', 1, '2022-12-26', '2022-12-26 05:10:34', 'Admin', 5, '58190263320221226_061034.jpg', 'Send');
