INSERT INTO `tbl_news` (`ID`, `Name`, `Content`, `t_id`, `date_get`, `date_up`, `m_username`, `idDept`, `news_img`, `Status`) VALUES
(1, 'กิจกรรมวิ่ง SBAC FUN RUN 2022 “พี่ได้รัน น้องได้เรียน” วันอาทิตย์ที่ ๖ เดือนพฤศจิกายน พ.ศ. ๒๕๖๕ ณ สวนสุขภาพกองทัพอากาศชาวฟ้า', '<p>วันอาทิตย์ที่ ๖ เดือนพฤศจิกายน พ.ศ. ๒๕๖๕ เวลา ๐๕.๐๐ น. สมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) (เอสแบค - ที เอ เอ) ได้มีกิจกรรมวิ่ง SBAC FUN RUN 2022 ภายใต้แนวคิด “พี่ได้รัน น้องได้เรียน” ณ สวนสุขภาพกองทัพอากาศชาวฟ้า โดย ดร.ปราศรัย ประวัติรุ่งเรือง นายกสมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) พล.อ.ท.สมพร แต้พานิช เจ้ากรมกิจการพลเรือนทหารอากาศ นายสมบัติ กนกทิพย์วรรณ ผู้อำนวยการเขตสายไหม ได้ร่วมกิจกรรมวิ่งในครั้งนี้ด้วย</p><p>สมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) ให้ความสำคัญต่อการส่งเสริมการศึกษา ช่วยเหลือนักเรียนนักศึกษาที่ขาดแคลน หรือด้อยโอกาสทางการศึกษา ซึ่งในปี ๒๕๖๕ นี้ ร่วมมือกับกรมกิจการพลเรือนทหารอากาศ จัดกิจกรรม SBAC FUN RUN 2022 ขึ้น มีวัตถุประสงค์เพื่อให้นักศึกษาทั้งศิษย์เก่า ศิษย์ปัจจุบัน ผู้ปกครอง ตลอดทั้งประชาชนในชุมชน หน่วยงานต่าง ๆ ได้ออกกำลังกายเพื่อสุขภาพ</p><p>ตระหนักถึงความสำคัญในการดูแลรักษาสิ่งแวดล้อมภายในสวนสาธารณะของชุมชนให้เป็นพื้นที่สีเขียวสะอาด เหมาะสำหรับการพักผ่อนและออกกำลังกาย โดยรายได้ทั้งหมดเป็นทุนสนับสนุนการศึกษาให้แก่นักเรียนนักศึกษาที่ขาดแคลนทุนทรัพย์ในการศึกษาเล่าเรียน มีผู้สนใจร่วมกิจกรรมวิ่งจำนวนมาก เช่น ศิษย์เก่า ศิษย์ปัจจุบัน ครูอาจารย์ ผู้ปกครอง ของวิทยาลัยเทคโนโลยีสามบริหารธุรกิจ (เอสแบค) ชุมชนในเขตสายไหม เขตดอนเมือง เขตบางเขน และประชาชนทั่วไป จำนวนประมาณ ๒,๐๐๐ คน อีกทั้งยังได้รับการสนับสนุนจากหน่วยงานต่างๆ อีกมากมาย อาทิเช่น มหาวิทยาลัยนอร์ทกรุงเทพ บริษัท กันกุล เอ็นจิเนียริ่งจำกัด บริษัท คาราบาวแดง จำกัด บริษัท ปตท. น้ำมันและการค้าปลีก จำกัด (มหาชน) เป็นต้น</p><p>สำหรับรางวัลกิจกรรม SBAC FUN RUN 2022 “พี่ได้รัน น้องได้เรียน” ประกอบด้วยการแข่งขัน ๒ ระยะทาง คือระยะ ๒.๕ กิโลเมตรประเภทชายและหญิง และระยะ ๕ กิโลเมตรประเภทชายและหญิง รับถ้วยรางวัล พร้อมทุนการศึกษา มูลค่ารวม ๘๘,๐๐๐.๐๐ บาท ดังนี้</p><p>- รางวัลชนะเลิศ รับถ้วยรางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบค ๑๐,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๑ รับถ้วยรางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบค ๗,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๒ รับถ้วยรางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบค ๕,๐๐๐ บาท</p><p>นอกจากนั้นมีรางวัลพิเศษสำหรับการแข่งขันระยะ ๕ กิโลเมตร คือผู้ที่เข้าเส้นชัยคนแรกทั้งชาย และหญิงจะได้รับ IPAD Gen 9 อีกคนละ ๑ เครื่อง</p><p>และสำหรับผู้ที่สนใจสนับสนุนทุนการศึกษาให้น้อง ๆ ยังสามารถสนับสนุนต่อได้ โดยซื้อ Gift set รับของที่ระลึกจากสมาคม ฯ มากมาย เช่น เสื้อ กระเป๋า แก้วเก็บความร้อน/เก็บความเย็น รวมถึงตุ๊กตาหมี SBAC-TAA น่ารัก ๆ อีกด้วย โดยติดตามข่าวสารกิจกรรมของสมาคม ฯ ในเพจ www.facebook.com/sbacfunrun หรือ เพจวิทยาลัยฯ www.sbac.ac.th</p><p>สำหรับรางวัลกิจกรรม SBAC FUN RUN 2022 “พี่ได้รัน น้องได้เรียน” ประกอบด้วยการแข่งขัน ๒ ระยะทาง คือระยะ ๒.๕ กิโลเมตรประเภทชายและหญิง และระยะ ๕ กิโลเมตรประเภทชายและหญิง มีผู้ที่ได้รับรางวัล ดังนี้</p><p>ระยะ 5 กิโลเมตร ประเภทชาย</p><p>รางวัลชนะเลิศ ได้แก่ คุณอาทิตย์ธา วีระธรรมวาทิน รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๑๐,๐๐๐ บาท และ IPAD Gen 9 มูลค่า ๑๕,๐๐๐ บาท จำนวน ๑ เครื่อง</p><p>- รางวัลรองชนะเลิศอันดับ ๑ คุณอนุภาค โพธิเมธา รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๗,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๒ คุณกฤตนัย ใจแก้ว รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๕,๐๐๐ บาท</p><p>ระยะ 5 กิโลเมตร ประเภทหญิง</p><p>รางวัลชนะเลิศ ได้แก่ เด็กหญิงพัชญ์พิดา แซ่เฉี่ยน รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๑๐,๐๐๐ บาท และ IPAD Gen 9 มูลค่า ๑๕,๐๐๐ บาท จำนวน ๑ เครื่อง</p><p>- รางวัลรองชนะเลิศอันดับ ๑ คุณสุธินี ราสพ์ รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๗,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๒ คุณขวัญดาว จริส รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๕,๐๐๐ บาท</p><p>ระยะ 2.5 กิโลเมตร ประเภทชาย</p><p>- รางวัลชนะเลิศ ได้แก่ คุณสุเมธ ศิริขจรอาชา รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๑๐,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๑ คุณกิตติพัฒน์ ภู่สุวรรณ รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๗,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๒ คุณนนนรา เสริมสุข รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๕,๐๐๐ บาท</p><p>ระยะ 2.5 กิโลเมตร ประเภทหญิง</p><p>- รางวัลชนะเลิศ ได้แก่ เด็กหญิงอชิรญา พิจริยชัย รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๑๐,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๑ คุณสุภัทรตรา ชูชื่นพรม รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๗,๐๐๐ บาท</p><p>- รางวัลรองชนะเลิศอันดับ ๒ เด็กหญิงเพ็ญนิภา พานิกรณ์ รับโล่รางวัล พร้อมทุนเรียนต่อระดับ ปวช. และ ปวส. ที่เอสแบคมูลค่า ๕,๐๐๐ บาท</p>', 1, '2022-12-26', '2022-12-25 20:08:15', 'Admin', 1, '209305841920221225_210815.png', 'Send'),
(2, 'งานแถลงข่าว SBAC FUN RUN 2022 “พี่ได้รัน น้องได้เรียน” วันพุธที่ ๑๙ เดือนตุลาคม พ.ศ. ๒๕๖๕ ณ ห้องประชุมชั้น ๒ SBAC Digital Space ', '<p>วันพุธที่ ๑๙ เดือนตุลาคม พ.ศ. ๒๕๖๕ เวลา ๑๐.๐๐ น. ดร.ปราศรัย ประวัติรุ่งเรือง นายกสมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) และผู้อำนวยการวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC) พล.อ.ท.สมพร แต้พานิช เจ้ากรมกิจการพลเรือนทหารอากาศ นายสมบัติ กนกทิพย์วรรณ ผู้อำนวยการเขตสายไหม และนายณัฐพร รอดเรือง ประธานสมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) ร่วมแถลงข่าว SBAC FUN RUN 2022 ภายใต้แนวคิด “พี่ได้รัน น้องได้เรียน” วิ่งเพื่อเป็นทุนการศึกษาให้น้องๆที่คลาดแคลนทุนทรัพย์ ณ ห้องประชุมชั้น ๒ SBAC Digital Space วิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC)</p><p>&nbsp;</p><p>สมาคมศิษย์เก่าและครูวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC-TAA) ได้ให้ความสำคัญต่อการส่งเสริมการศึกษา ช่วยเหลือนักเรียนนักศึกษาที่ขาดแคลน หรือด้วยโอกาสทางการศึกษา ตลอดทั้งทำจัดกิจกรรมเพื่อส่งเสริมทางด้านวิชาการ วิชาชีพให้แก่สังคมอย่างต่อเนื่อง ซึ่งในปี ๒๕๖๕ นี้ ได้ร่วมมือกับกรมกิจการพลเรือนทหารอากาศ สำนักงานเขตสายไหม จัดกิจกรรม SBAC FUN RUN 2022 ขึ้นในวันอาทิตย์ที่ ๖ พฤศจิกายน ๒๕๖๕ เวลา ๐๕.๐๐ น. ณ สวนสุขภาพกองทัพอากาศชาวฟ้า กำหนดเป้าหมายผู้ร่วมกิจกรรมวิ่ง คือศิษย์เก่า ศิษย์ปัจจุบัน ผู้ปกครอง ชุมชนในเขตสายไหม เขตดอนเมือง เขตบางเขน และประชาชนทั่วไปจำนวน ๒,๐๐๐ คน มีวัตถุประสงค์เพื่อให้นักศึกษาทั้งศิษย์เก่า ศิษย์ปัจจุบัน ผู้ปกครอง ตลอดทั้งประชาชนในชุมชน หน่วยงานต่าง ๆ ได้ออกกำลังกายเพื่อสุขภาพที่แข็งแรง ตระหนักถึงความสำคัญในการดูแลรักษาสิ่งแวดล้อมภายในสวนสาธารณะของชุมชนให้เป็นพื้นที่สีขียว สะอาด เหมาะสำหรับการพักผ่อนและออกกำลังกาย โดยรายได้ทั้งหมดเป็นทุนสนับสนุนการศึกษาให้แก่นักเรียนนักศึกษาที่ขาดแคลนทุนทรัพย์ในการศึกษาเล่าเรียน</p><p>กิจกรรม SBAC FUN RUN 2022 “พี่ได้รัน น้องได้เรียน” เปิดรับสมัครอย่างเป็นทางการแล้ว โดยจะจัดแข่งขันในวันอาทิตย์ที่ ๖ พฤศจิกายน ๒๕๖๕ เวลา ๐๕.๐๐ น. ประกอบด้วยการแข่งขัน 2 ระยะทาง คือระยะ ๒.๕ กิโลเมตร และระยะ ๕ กิโลเมตร ผู้ที่ชนะได้รับถ้วยรางวัลชนะเลิศ รางวัลรองชนะเลิศอันดับ ๑ และรองชนะเลิศอันดับ ๒ พร้อมทุนการศึกษาเรียนต่อระดับ ปวช. และ ปวส. ที่วิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC) มูลค่า ๖๖,๐๐๐.๐๐ บาท และมีรางวัลพิเศษสำหรับการแข่งขันระยะ ๕ กิโลเมตร คือผู้ที่เข้าเส้นชัยคนแรกชายและหญิงจะได้รับ IPAD Gen 9 อีกคนละ ๑ เครื่อง ซึ่งขณะนี้ยังเปิดรับสมัครอยู่ หากท่านใดยังไม่ได้สมัครสามารถเข้าไปสมัครเพิ่มได้ หรือติดตามข้อมูลงานวิ่งได้ในเพจ www.facebook.com/sbacfunrun หรือ เพจวิทยาลัยฯ www.sbac.ac..th</p><p>\"&gt;</p>', 3, '2022-12-26', '2022-12-25 20:09:31', 'Admin', 2, '143464785420221225_210931.jpg', 'Send'),
(3, 'นักศึกษา SBAC เป็นตัวแทนของสถาบันอาชีวศึกษาทั่วประเทศ ร่วมการประชุมระดับนานาชาติ ณ ประเทศไต้หวัน ระหว่างวันที่ 15-19 พฤศจิกายน 2565', '<p>นักศึกษาวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC) นำโดยนางสาวณัฐชา อินทนาวรานนท์ นักศึกษาระดับปวส.2 สาขาการโรงแรม และนายไฆตะ คาวาดะ นักศึกษาระดับปวช.2 สาขาคอมพิวเตอร์กราฟิก ได้เข้าร่วมงาน APEC Forum on Entrepreneurship for the Future of Work : Accelerating Regional Economic Recovery and Digital Inclusion for Women and Youth in the Post Pandemic Era. ณ ประเทศไต้หวัน ในระหว่างวันที่ 15-19 พฤศจิกายน 2565</p><p>&nbsp;</p><p>โดยมี ดร.ปราศรัย ประวัติรุ่งเรือง ผู้อำนวยการวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC) พร้อมด้วย ดร.อิสริยา วรพิพัฒน์ และผู้บริหาร SBAC ได้ร่วมส่งกำลังใจและไปส่งนักศึกษา ณ สนามบินสุวรรณภูมิ ซึ่งการเข้าร่วมกิจกรรมครั้งนี้ นักศึกษา SBAC ได้รับการคัดเลือกเป็นตัวแทนของวิทยาลัยอาชีวศึกษาทั่วประเทศ จาก 800 กว่าแห่ง เพียงวิทยาลัยเดียวเท่านั้นที่เข้าร่วมการประชุมระดับนานาชาติครั้งนี้ โดยในงานนักศึกษา SBAC ต้องมีการนำเสนองานเกี่ยวกับแผนธุรกิจ ให้แก่ผู้เข้าร่วมการประชุมด้วย</p><p>ซึ่งเป็นความภาคภูมิใจของผู้บริหาร บุคลากร นักศึกษาทุกคนในวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC) ที่มีตัวแทนได้โอกาสไปสร้างชื่อเสียงให้ทั้ง SBAC และประเทศไทยด้วย</p>', 1, '2022-12-26', '2022-12-26 05:16:47', 'Admin', 5, '187343065720221226_061647.png', 'Keep'),
(4, 'กิจกรรมงานแถลงข่าวการประกวด SBAC Freshy Boys & Girls 2022 SBAC สะพานใหม่-นนทบุรี᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼᲼', '<p>วันที่ ๒๗ มิถุนายน ๒๕๖๕ ณ ห้องประชุมรัตนาธิเบศร์ วิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ นนทบุรี (SBAC) มีการจัดงานแถลงข่าวการประกวด SBAC Freshy Boys &amp; Girls 2022 ของ SBAC สะพานใหม่-นนทบุรี โดยมีนายสุจินต์ ไชยชุมศักดิ์ ผู้ว่าราชการจังหวัดนนทบุรี เป็นประธานกล่าวเปิดงานแถลงข่าว พร้อมด้วย ดร.ปราศรัย ประวัติรุ่งเรือง ผู้อำนวยการวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC สะพานใหม่) ดร.ประสาน ประวัติรุ่งเรือง ผู้อำนวยการวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ นนทบุรี (SBAC นนทบุรี) ดร.อิสริยา วรพิพัฒน์ รองผู้อำนวยการวิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC สะพานใหม่) ตลอดทั้งมีผู้บริหารและหน่วยงานสนับสนุนการจัดงาน เช่น มหาวิทยาลัยนอร์ทกรุงเทพ บริษัทตลาดยิ่งเจริญ บริษัทเดอะแกรนด์โรส บริษัททรู คอเปอร์เรชั่น จำกัด สถาบันยุวทัศน์แห่งประเทศไทย ผู้แทนชุมชน ๕ ชุมชนเเหล่งเรียนรู้สู่สังคมที่ยั่งยืน (ชุมชนท่องเที่ยวปลายบาง บางม่วง,ชุมชนตลาดน้ำวัดไทรน้อย,ชุมชนเกาะเกร็ด,ชุมชนบ้าน ๑๐๐ ปี ,ชุมชนวัดศรีเรืองบุญ) และนักศึกษาผู้เข้าร่วมประกวด Freshy Boys &amp; Girls 2022</p><p>&nbsp;</p><p>สำหรับการจัดงานการประกวด SBAC Freshy Boys &amp; Girls 2022 วิทยาลัยเทคโนโลยีสยามบริหารธุรกิจ (SBAC สะพานใหม่) กำหนดวันที่ ๘ กรกฏาคม ๒๕๖๕ จัดรอบ ไรซิ่งสตาร์ “สะพานใหม่ชุมชนตลาดแห่งสายน้ำ” ณ ตลาดยิ่งเจริญ และรอบ Final ในวันที่ ๑๒ กรกฏาคม ๒๕๖๕ ณ ห้องประชุมเอราวัณ มหาวิทยาลัยนอร์ทกรุงเทพ</p><p>\"&gt;</p>', 3, '2022-12-26', '2022-12-26 05:25:07', 'Admin', 5, '174125045220221226_062507.jpg', 'Send');
